import React from 'react'
import SelectedFullCabDetails from './SelectedFullCabDetails'

const FullCarBookingForm = () => {
  return (
    <div>
      {/* <SelectedFullCabDetails/> */}
      <form className="bg-gray-50 p-4 md:p-8 shadow-lg rounded-lg">
                        <h2 className="text-xl md:text-2xl font-semibold text-center text-gray-900 mb-6">Booking Details</h2>

                        {/* Passenger Details Grid */}

                        {/* Submit Button */}
                        <div className="text-center mt-8">
                            <button
                                type="submit"
                                className="px-6 py-3 text-sm font-medium rounded-md shadow "
                            >
                                Book Car
                            </button>
                        </div>
                    </form>
    </div>
  )
}

export default FullDetails
